cypher:
MATCH (i:ID)-[:HAS_POSITION_PARAMETERS]->(p:Position_Parameters)
WHERE NOT EXISTS {
  MATCH (i)-[:HAS_STRESS_STATUS]->(s:Stress_Status)
  WHERE s.Status = 'large'
}
RETURN DISTINCT p.R_RotationAngle

MATCH (s:Shape_Parameters)
WHERE NOT EXISTS {
  MATCH (s)<-[:HAS_SHAPE_PARAMETERS]-(i:ID)-[:HAS_STRESS_STATUS]->(st:Stress_Status)
  WHERE st.Status = 'large'
}
RETURN s
